import React from 'react';
import Carousel from '../components/ui/Carousel';

interface OwnProps {
    text: string;
  }

  type Props = OwnProps;



const Index = ({ text }: Props) =>
    <div>
        <h2>{text}</h2>
        <Carousel/>
    </div>;

export default Index;
